import React from "react";
import "./App.css";
import AddTransaction from "./components/AddTransaction";
import { Provider } from "react-redux";

function App() {
  return (
    <div className="App">
      <Provider>
        <AddTransaction />
      </Provider>
    </div>
  );
}

export default App;
